mapper.select:

select 

from FEPSVCCTL
where FEPSVCCTL_SUBSYS = #{fepsvcctlSubsys,jdbcType=DECIMAL}
  and FEPSVCCTL_SVCNAME = #{fepsvcctlSvcname,jdbcType=VARCHAR}

mapper.delete:

delete from FEPSVCCTL
where FEPSVCCTL_SUBSYS = #{fepsvcctlSubsys,jdbcType=DECIMAL}
  and FEPSVCCTL_SVCNAME = #{fepsvcctlSvcname,jdbcType=VARCHAR}

mapper.update:

update FEPSVCCTL
set FEPSVCCTL_SVCURL = #{fepsvcctlSvcurl,jdbcType=VARCHAR},
  FEPSVCCTL_STATE = #{fepsvcctlState,jdbcType=VARCHAR},
  FEPSVCCTL_COUNT = #{fepsvcctlCount,jdbcType=SMALLINT},
  FEPSVCCTL_DESC = #{fepsvcctlDesc,jdbcType=VARCHAR}
where FEPSVCCTL_SUBSYS = #{fepsvcctlSubsys,jdbcType=DECIMAL}
  and FEPSVCCTL_SVCNAME = #{fepsvcctlSvcname,jdbcType=VARCHAR}
